function doAjaxRequest(uriValue, dataValue,functionValue,syncType){
	var rootValue = $("#host").val();
	var urlValue = rootValue + uriValue;
	if (typeof syncType == "undefined")
		syncType = true;
	$.ajax({
		type : "POST",
		url : urlValue,
		data : dataValue,
		processData: false,
		async : syncType,
		success :function(response){
			functionValue(response);
		},
		error : function(xhr, status, error) {
			alert(error);
		}
	});
}
function doVoidAjaxRequest(uriValue, dataValue){
	var rootValue = $("#host").val();
	var urlValue = rootValue + uriValue;
	$.ajax({
		type : "POST",
		url : urlValue,
		data : dataValue,
		processData: false,
		async : false,
		error : function(xhr, status, error) {
			alert(error);
		}
	});
}function doAdminAjaxRequest(pageName, dataValue){
	var functionValue = function(response){
		var $data = $($.parseHTML(response));
		var $templateBody = $($data.find('.adminContent'));
		$('.adminContent').html($templateBody.html());
		$(".addit-img-content").each(function(){
			$(".main").height($(".main").height()+$(this).height());
		});
		$(".interfaceValue").click(function(){
			var isChecked = $(this).prop("checked")?true:false;
			if (isChecked){
				$(this).parent().find("#interface").val("1");
			} else {
				$(this).parent().find("#interface").val("0");
			}
		});
	};
	doAjaxRequest(pageName, dataValue,functionValue);
}
