function goOn(formId,pageName,event){
	if (!event)
		event = window.event;
	(event.preventDefault) ? event.preventDefault() : event.returnValue = false;
	var errorMsg = "";
	$(".validate-field").each(function(){
		var value = $(this).val();
		value = value.replace(/ /g, "");
		if (value.length==0){
			var field = $(this).attr("id");
			if (field=="mainImgb64")
				field = "imagine";
			errorMsg+="<span>Introduceti date corecte in campul "+field+"!</span><br/>";
		}
	});
	if (errorMsg.length==0){
		if ($("input[name='base64Content']").length>0)
			$("input[name='base64Content']").each(function(){
				var value = $(this).val().replace(",","&comma&");
				$(this).val(value);
			});
		var formData = $("#"+formId).serialize();
		doAdminAjaxRequest(pageName, formData);
	}
	else{
		$("#errorMsg").html("");
		$("#errorMsg").append(errorMsg);
		$("#errorBox").modal();
	}
}
