function shrinkImage(content,extension){
	var result = content.substring(0,content.indexOf(",")+1);
	content = content.substring(content.indexOf(",")+1,content.length);
	if (content.length>140000){
		var length = 140000;
		var max = content.length;
		var newContent = "";
		while (length<max){
			if (length<max-140000){
				var dataValue = "content="+ content.substring(0,140000);
				content = content.substring(140000,content.length);
				var functionValue = function(){};
				doAjaxRequest("/administration/chunks", dataValue, functionValue, false);
				length+=140000;
			} else {
				var dataValue = "content="+ content+"&finish=true&extension="+extension;
				var functionValue = function(response){
					newContent = response;
				};
				doAjaxRequest("/administration/chunks", dataValue, functionValue, false);
				length = max;
			}
		}
		return result + newContent;
	}
}